import requestsfrom bs4 import BeautifulSoupimport csv# Make a requestpage = requests.get(#'https://www.ryanair.com/gb/en/trip/flights/\#select?adults=1&teens=0&children=0&infants=0&dateOut=2022-06-10&dateIn=2022-06-12\#&isReturn=true&discount=0&originIata=PDV&destinationIata=STN&tpAdults=1&tpTeens=0&tpChildren=0\#&tpInfants=0&tpStartDate=2022-06-10&tpEndDate=2022-06-12&tpDiscount=0&tpOriginIata=PDV&tpDestinationIata=STN')"https://buildingdz.wordpress.com")    #"https://codedamn-classrooms.github.io/webscraper-python-codedamn-classroom-website/")soup = BeautifulSoup(page.content, 'html.parser')# Create top_items as empty listall_products = []# Extract and store in top_items according to instructions on the leftproducts = soup.select('div p.site-title a')for product in products:    name = product.select('h1.entry-title')[0].text.strip()    #description = product.select('div.entry-content')[0].find_all('img')    #price = product.select('h1.price')[0].text.strip()    #reviews = product.select('div.ratings')[0].text.strip()    #image = product.select('img')[0].get('src')    all_products.append({        "name": name,        #"description": description,        #"price": price,        #"reviews": reviews,        #"image": image    })keys = all_products[0].keys()with open('products.csv', 'w', newline='') as output_file:    dict_writer = csv.DictWriter(output_file, keys)    dict_writer.writeheader()    dict_writer.writerows(all_products)